import React from 'react';
import { useState } from 'react';
const App = () => {
    const [num,setNum]=useState(0)

    return (
        <>
            <div className="main_div">
                <div className="center_div">
                    <h1>{ num}</h1>
                    <div className="btn_div" >
                        <button> Increment</button>
                        <button>Decrement</button>
                    </div>

                </div>

            </div>
        </>
    )
}
export default App;
